css:
.header-view {
  position: fixed;
  width: 100%;
  z-index: 10;
  position: relative;
}
.header-view .heading-close {
  color: #d9dbde;
}
.header-view .heading-title {
  padding-left: 6px;
}
.header-view .heading-status {
  padding-left: 9px;
}
.header-view .icon-alert {
  color: #e2c08d;
}
.header-view .icon-check {
  color: #73c990;
}
.header-view .icon-hourglass {
  color: #a3a8ae;
}
.header-view .icon-stop {
  color: #ff6347;
}
.script-view {
  overflow: scroll;
  max-height: 300px;
  height: auto;
  margin-bottom: 0px;
}
.script-view .panel-body pre {
  background: #161719;
  color: #a3a8ae;
}
.script-view .stderr {
  color: #ff6347;
}
.script-view .line {
  border-radius: 0px;
  margin: 0px;
  padding: 0px;
}
